import './App.css';

function App() {
  axios.get('http://localhost:5000')
  return (
    <div className="App">
      <div id="center">
        <h1>PARA<span id='title'>PLUIE</span></h1>
        <p>FOR THE JESSE LIVERMOORE OF TODAY</p>
        <button id='start'>GET STARTED</button>
    </div>
    <div id ="about">About</div>
    <div id ="support">Support</div>
    </div>
  );
}

export default App;
